import './Nav.css'
import React from 'react'
import { NavLink } from 'react-router-dom'

const Nav = () => {
	return (
		<div className="Nav">
			<p className='Separator'>Analysis</p>
			<NavLink to={"/Blast"} className={({ isActive }) => isActive?"Active":null}>Blast</NavLink>
			<p className='Separator'>System</p>
		</div>
	)
}

export default Nav
